import React, { Component } from 'react';
import router from 'next/router'


import Head from 'next/head';

class Links extends Component {

    constructor(props) {
        super(props);
        this.state = {
            linkObj: '',
            name: ''
        }
    }

    UNSAFE_componentWillMount() {
        this.setLinkObj();
    }

    setLinkObj=()=> {
        
        console.log("Props: ", this.props.name);
        this.setState({linkObj: this.props.linkObj});
    }

    getLinkObj=()=> {
        
        
        console.log("Link : ", this.state.linkObj);
    }

    render() {
        
        return (
            <div>
                <Head>
                    <link href="https://fonts.googleapis.com/css?family=Montserrat:300,400,500,600,700&display=swap" rel="stylesheet" />
                    <link href="/static/style.css" rel="stylesheet" />
                </Head>
                <main className="main">
                {this.getLinkObj()}
                    <div className="main-banner" style={{backgroundImage: "url(images/bg-shape2.svg)"}}>
                        <span className="shape-right"><img src="images/icon-price.png" alt="Image description" /></span>
                        <div className="container">
                            <div className="textblock">
                                <h1>Complete EMR Solution</h1>
                                <p>Providers can record procedures and treatment markings with full, customizable and compliant documentation all from their iPad. Simultaneously, they can deduct units from inventory, create sales invoices, send charts to a Medical Director, and start the clock for patient follow-up and surveys</p>
                                <div className="btn-area">
                                    <span className="shape-center"><img src="images/icon-dark.png" alt="Image description" /></span>
                                    <a href="#" className="btn">Schedule Demo</a>
                                    <a href="#" className="btn full">Start Free Trial</a>
                                </div>
                                <span className="note">No Credit Card Required, 14 Day Free Trial</span>
                            </div>
                        </div>
                    </div>
                    <div className="full-image">
                        <span className="shape-left"><img src="images/icon-pricing.png" alt="Image Description" /></span>
                        <img src="images/img67.png" alt="Image description" />
                    </div>
                </main>
            </div>

        );
    }
}
export default Links;
